import React from 'react';
import './App.css';
import staringCat from 'https://cdn.pixabay.com/photo/2017/02/20/18/03/cat-2083492_1280.jpg';
import Image from './Image';

function App() {
  <main>
    <Image src={staringCat} alt="Cute cat staring" />
  </main>
}

export default App;
